import React from 'react';
import styled from 'styled-components';
import { Link, NavLink } from 'react-router-dom';

const StyledFooter = styled.footer`
  background-color: #cc9900;
  padding: 35px 0;
  position: relative;
  bottom: 0;
  left: 0;

  @media screen and (max-width: 768px) {
    padding: 35px 0 10px 0;
  }
`;
const StyledFooterNav = styled.nav`
  justify-content: space-between;

  @media screen and (max-width: 768px) {
    margin-bottom: 25px;
  }
`;

const StyledFooterNavItem = styled(NavLink)`
  margin: 0 10px;

  @media screen and (max-width: 768px) {
    margin: 0.4em 0;
  }
`;

const StyledFooterLink = styled(Link)`
  &:hover {
    color: ;
  }
`;

const StyledSocialLink = styled.a`
  &:hover {
    color: ;
  }
`;

const StyledLeftFooterLinkContainer = styled.div`
  width: 40%;
  justify-content: space-between;
`;

const StyledCopyright = styled.div`
  text-align: center;
`;

const StyledFooterSocialLinks = styled.div`
  @media screen and (max-width: 768px) {
    margin-top: 25px;
  }
`;

const StyledNavList = styled.div`
  @media screen and (max-width: 768px) {
    flex-direction: column;
    justify-content: center;
    margin-top: 1em;
    padding: 0;
  }
`;

// Component function
const Footer = () => {
  return (
    <StyledFooter>
      <div className="container">
        <StyledFooterNav
          id="footer-nav"
          className="nav-links-container flex-item footer-flex"
        >
          <StyledLeftFooterLinkContainer
            id="left-footer-link-container"
            className="flex-item footer-flex"
          >
            <StyledFooterLink
              className="logo light-text link footer-link"
              to="/"
            >
              T
            </StyledFooterLink>
            <div id="footer-nav-links">
              <StyledNavList
                id="footer-nav-menu"
                className="flex-item nav-list"
              >
                <StyledFooterNavItem
                  className="footer-nav-item nav-item link light-link"
                  exact
                  to="/"
                  activeStyle={{
                    backgroundColor: 'rgb(238, 238, 238)',
                    color: '#47684a',
                  }}
                >
                  Home
                </StyledFooterNavItem>
                <StyledFooterNavItem
                  className="footer-nav-item nav-item link light-link"
                  exact
                  to="/about"
                  activeStyle={{
                    backgroundColor: 'rgb(238, 238, 238)',
                    color: '#47684a',
                  }}
                >
                  About
                </StyledFooterNavItem>
                <StyledFooterNavItem
                  className="footer-nav-item nav-item link light-link"
                  exact
                  to="/projects"
                  activeStyle={{
                    backgroundColor: 'rgb(238, 238, 238)',
                    color: '#47684a',
                  }}
                >
                  Projects
                </StyledFooterNavItem>
                <StyledFooterNavItem
                  className="footer-nav-item nav-item link light-link"
                  exact
                  to="/contact"
                  activeStyle={{
                    backgroundColor: 'rgb(238, 238, 238)',
                    color: '#47684a',
                  }}
                >
                  Contact
                </StyledFooterNavItem>
              </StyledNavList>
            </div>
          </StyledLeftFooterLinkContainer>
          <StyledFooterSocialLinks id="footer-social-links">
            <StyledSocialLink
              className="social-link link light-text"
              href=""
              target="_blank"
              rel="noreferrer"
              aria-label=""
            >
              <svg
                xmlns=""
                width="16"
                height="16"
                fill="currentColor"
                className=""
                viewBox="0 0 16 16"
              >
                <path d="M8 0C3.58 0 0 3.58 0 8c0 3.54 2.29 6.53 5.47 7.59.4.07.55-.17.55-.38 0-.19-.01-.82-.01-1.49-2.01.37-2.53-.49-2.69-.94-.09-.23-.48-.94-.82-1.13-.28-.15-.68-.52-.01-.53.63-.01 1.08.58 1.23.82.72 1.21 1.87.87 2.33.66.07-.52.28-.87.51-1.07-1.78-.2-3.64-.89-3.64-3.95 0-.87.31-1.59.82-2.15-.08-.2-.36-1.02.08-2.12 0 0 .67-.21 2.2.82.64-.18 1.32-.27 2-.27.68 0 1.36.09 2 .27 1.53-1.04 2.2-.82 2.2-.82.44 1.1.16 1.92.08 2.12.51.56.82 1.27.82 2.15 0 3.07-1.87 3.75-3.65 3.95.29.25.54.73.54 1.48 0 1.07-.01 1.93-.01 2.2 0 .21.15.46.55.38A8.012 8.012 0 0 0 16 8c0-4.42-3.58-8-8-8z" />
              </svg>
            </StyledSocialLink>
            <StyledSocialLink
              className="social-link link light-text"
              href=""
              target="_blank"
              rel="noreferrer"
              aria-label=""
            >
              <svg
                xmlns="http://www.w3.org/2000/svg"
                width="16"
                height="16"
                fill="currentColor"
                className=""
                viewBox="0 0 16 16"
              >
                <path d="" />
              </svg>
            </StyledSocialLink>
            <StyledSocialLink
              className="social-link link light-text"
              href=""
              target="_blank"
              rel="noreferrer"
              aria-label=""
            >
              <svg
                xmlns="http://www.w3.org/2000/svg"
                width="16"
                height="16"
                fill="currentColor"
                className=""
                viewBox="0 0 16 16"
              >
                <path d="" />
              </svg>
            </StyledSocialLink>
          </StyledFooterSocialLinks>
        </StyledFooterNav>
        <StyledCopyright id="">
          <p>
            <StyledFooterLink
              className="light-text quicksand footer-link"
              
              target="_blank"
              rel="noreferrer"
            >
              &copy; 2021 Tucker Barrett
            </StyledFooterLink>
          </p>
        </StyledCopyright>
      </div>
    </StyledFooter>
  );
};

export default Footer;
